            Date: vars.Date,
            Seat_number: vars.Seat_number,
            Customer_id: vars.Customer_id,
            Customer_name: vars.Customer_name
        };
        console.log(data);
        insertSql.setRESERVATION(data);
    }
    res.redirect('/user');
})

module.exports = router;

